import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AdminHome from "./admin/adminhome";

export default function App() {
  return (
    <div>
      <Router>
        <Routes>
          <>
            <Route path="/home" element={<AdminHome />} />
          </>
        </Routes>
      </Router>
    </div>
  );
}
